import React from 'react';
import { NavLink } from 'react-router-dom';
import Programs from '../Programs/Programs';

const Header = () => {
    return (
        <div>
            <h1>This is header section.</h1>
            <NavLink to="/programs">
             <Programs></Programs>
            </NavLink>
        </div>
    );
};

export default Header;
